.tip-item-move {
  display: inline-block;
  margin-right: 10px;
}
.tip-enter-active, .tip-leave-active {
  transition: all 0.3s;
}
.tip-enter, .tip-leave-to
/* .list-leave-active for below version 2.1.8 */ {
  opacity: 0;
  transform: translateX(30%);
}

.common-tip {
  position: fixed;
  right: 20px;
  top: 83px;
  z-index: 9999;
  .info {
    border-left-width: 3px;
    border-left-style: solid;
  }
  .common-tip-even {
    box-shadow: 0px 2px 10px rgba(0,0,0,0.15);
    width: 280px;
    min-height: 60px;
    margin-bottom: 26px;
    border-left-width: 3px;
    border-left-style: solid;
    box-sizing: border-box;
    transition: all 0.3s;
    padding: 22px 25px 22px 52px;
    position: relative;
    .icon {
      position: absolute;
      width: 16px;
      height: 16px;
      top: 25px;
      left: 20px;
      border-radius: 50%;
    }
    .text{
      font-family: PingFangSC-Regular;
      font-size: 14px;
      letter-spacing: 0;
      text-align: left;
      line-height: 22px;
    }
  }
}
